                <div class="ss-form-desc ss-no-ignore-whitespace" dir="ltr">The skills that get you into management are often not the skills you need to be a great leader. This programme has been specifically designed for first-time managers who want to:<br>- Learn the skills to succeed as a leader through practical training from experienced managers<br>- Join a lifelong network of other high performers<br>- Gain a personal skills gap analysis and learn what it means to be a great manager<p>You will gain all these and more through a mix of classroom sessions and personal career coaching. The programme will run part-time for 3 weeks starting 20 April 2015. <p>If you are a high-performing first-time manager who is interested in being part of the Emerging Managers programme, apply now as spaces are limited!</p></p></div>

